PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "django_migrations" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app" varchar(255) NOT NULL, "name" varchar(255) NOT NULL, "applied" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_user_groups" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_user_user_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_admin_log" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "object_id" text NULL, "object_repr" varchar(200) NOT NULL, "action_flag" smallint unsigned NOT NULL CHECK ("action_flag" >= 0), "change_message" text NOT NULL, "content_type_id" integer NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "action_time" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "django_content_type" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app_label" varchar(100) NOT NULL, "model" varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_permission" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "content_type_id" integer NOT NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "codename" varchar(100) NOT NULL, "name" varchar(255) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(150) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "auth_user" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "password" varchar(128) NOT NULL, "last_login" datetime NULL, "is_superuser" bool NOT NULL, "username" varchar(150) NOT NULL UNIQUE, "last_name" varchar(150) NOT NULL, "email" varchar(254) NOT NULL, "is_staff" bool NOT NULL, "is_active" bool NOT NULL, "date_joined" datetime NOT NULL, "first_name" varchar(150) NOT NULL);
CREATE TABLE IF NOT EXISTS "cadastros_fornecedores" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(40) NOT NULL, "cnpj" integer NOT NULL, "cep" integer NOT NULL, "phone" integer NOT NULL, "email" varchar(40) NOT NULL, "address" varchar(40) NOT NULL);
CREATE TABLE IF NOT EXISTS "cadastros_vendedores" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(40) NOT NULL, "cpf" integer NOT NULL, "phone" integer NOT NULL, "email" varchar(40) NOT NULL, "address" varchar(40) NOT NULL, "pix" varchar(60) NULL);
CREATE TABLE IF NOT EXISTS "cadastros_materiais_de_trabalho" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(40) NOT NULL, "unit" varchar(10) NOT NULL, "category" varchar(25) NOT NULL, "supplier_id" bigint NOT NULL REFERENCES "cadastros_fornecedores" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_session" ("session_key" varchar(40) NOT NULL PRIMARY KEY, "session_data" text NOT NULL, "expire_date" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "cadastros_tabelapreco" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "nome" varchar(30) NOT NULL);
CREATE TABLE IF NOT EXISTS "cadastros_tabelaprecoproduto" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "valor_sem_impostos" decimal NOT NULL, "produto_id" bigint NOT NULL REFERENCES "cadastros_products" ("id") DEFERRABLE INITIALLY DEFERRED, "tabela_preco_id" bigint NOT NULL REFERENCES "cadastros_tabelapreco" ("id") DEFERRABLE INITIALLY DEFERRED, "comissao_gerente_comercial" decimal NULL, "comissao_vendedor" decimal NULL, "comissao_vendedor2" decimal NULL);
CREATE TABLE IF NOT EXISTS "produtos_acabados_transferencia_estoque_saida_info" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT);
CREATE TABLE IF NOT EXISTS "produtos_acabados_transferencia_estoque_saida_produtos" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT);
CREATE TABLE IF NOT EXISTS "produtos_acabados_transferenciaestoquesaidaprodutos" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "quantidade_unitaria" integer NOT NULL, "quantidade_caixa" integer NOT NULL, "lote" varchar(20) NOT NULL, "data_fabricacao" date NOT NULL, "validade" date NOT NULL, "numero_transferencia_id" integer NOT NULL REFERENCES "produtos_acabados_transferenciaestoquesaidainfo" ("numero_transferencia") DEFERRABLE INITIALLY DEFERRED, "produto_id" bigint NOT NULL REFERENCES "cadastros_products" ("id") DEFERRABLE INITIALLY DEFERRED, "codigo_barra_caixa" varchar(14) NOT NULL, "codigo_barra_unidade" varchar(13) NOT NULL);
CREATE TABLE IF NOT EXISTS "cadastros_clientes" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(40) NOT NULL, "regime" varchar(10) NOT NULL, "cnpj" integer NOT NULL, "ie" integer NOT NULL, "cep" integer NOT NULL, "estado" varchar(2) NOT NULL, "cidade" varchar(40) NOT NULL, "rua" varchar(45) NOT NULL, "numero" varchar(10) NOT NULL, "complemento" varchar(50) NOT NULL, "nota_fiscal" varchar(24) NOT NULL, "Gerente_comercial_id" bigint NULL REFERENCES "cadastros_vendedores" ("id") DEFERRABLE INITIALLY DEFERRED, "vendedor_id" bigint NULL REFERENCES "cadastros_vendedores" ("id") DEFERRABLE INITIALLY DEFERRED, "vendedor_2_id" bigint NULL REFERENCES "cadastros_vendedores" ("id") DEFERRABLE INITIALLY DEFERRED, "TabelaPreco_id" bigint NULL REFERENCES "cadastros_tabelapreco" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "produtos_acabados_transferenciaestoquesaidainfo" ("numero_transferencia" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "data_saida" date NOT NULL, "motorista" varchar(40) NOT NULL, "veiculo" varchar(40) NOT NULL, "conferente" varchar(40) NOT NULL, "quantidade_pallets" integer NOT NULL, "observacoes" text NOT NULL, "validado" bool NOT NULL);
CREATE TABLE IF NOT EXISTS "cadastros_products_another_info" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(70) NOT NULL, "product_code" varchar(10) NULL, "product_bar_code" varchar(13) NULL, "box_bar_code" varchar(14) NULL, "box_quantity" integer NULL, "ncm" varchar(14) NULL, "cest" varchar(14) NOT NULL, "produto_pertence_id" bigint NOT NULL REFERENCES "cadastros_products" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "cadastros_products"
(
    id               integer     not null
        primary key autoincrement,
    name             varchar(70) not null,
    product_code     varchar(10),
    product_bar_code varchar(13),
    box_bar_code     varchar(14),
    category         varchar(15) not null,
    unit             varchar(10) not null,
    box_quantity     integer,
    gross_weight     decimal(5, 2),
    net_weight       decimal(5, 2),
    ncm              varchar(14),
    cest             varchar(14)
);
CREATE TABLE IF NOT EXISTS "vendas_pedidoitem" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "object_id" integer unsigned NOT NULL CHECK ("object_id" >= 0), "quantidade" integer unsigned NOT NULL CHECK ("quantidade" >= 0), "quantidade_caixas" integer unsigned NOT NULL CHECK ("quantidade_caixas" >= 0), "content_type_id" integer NOT NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "pedido_id" bigint NOT NULL REFERENCES "vendas_pedido" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "vendas_pedido" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "data" datetime NOT NULL, "cliente_id" bigint NOT NULL REFERENCES "cadastros_clientes" ("id") DEFERRABLE INITIALLY DEFERRED, "aprovado" bool NOT NULL);
CREATE TABLE IF NOT EXISTS "produtos_acabados_mistocomponent" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "object_id" integer unsigned NOT NULL CHECK ("object_id" >= 0), "lote" varchar(20) NOT NULL, "quantidade" integer NOT NULL, "content_type_id" integer NOT NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "misto_item_id" bigint NOT NULL REFERENCES "produtos_acabados_mistoitem" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "produtos_acabados_mistoitem" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "object_id" integer unsigned NOT NULL CHECK ("object_id" >= 0), "lote" varchar(20) NOT NULL, "quantidade_unitaria" integer NOT NULL, "content_type_id" integer NOT NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "produto_nome" varchar(70) NOT NULL, "date" date NULL);
CREATE TABLE IF NOT EXISTS "vendas_pedidoseparacao" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "lote" varchar(50) NOT NULL, "quantidade" integer unsigned NOT NULL CHECK ("quantidade" >= 0), "item_pedido_id" bigint NOT NULL REFERENCES "vendas_pedidoitem" ("id") DEFERRABLE INITIALLY DEFERRED, "pedido_id" bigint NOT NULL REFERENCES "vendas_pedido" ("id") DEFERRABLE INITIALLY DEFERRED);
